INSERT INTO `v1_28e7a4534da0fa02589ca9786c41749147ccabf68957cf661ffb9274f6cd661f` VALUES (9, 3001, 1, 3, 2, 0, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 5, 7, 1, "vo_minigame_1012_result_1084", 4.19, 12300152);
INSERT INTO `v1_28e7a4534da0fa02589ca9786c41749147ccabf68957cf661ffb9274f6cd661f` VALUES (9, 3001, 1, 3, 2, 0, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 5, 1, 1, "vo_minigame_1012_result_1085", 0.0, 12300153);
INSERT INTO `v1_28e7a4534da0fa02589ca9786c41749147ccabf68957cf661ffb9274f6cd661f` VALUES (9, 3001, 1, 3, 2, 0, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 5, 3, 1, "vo_minigame_1012_result_1086", 2.63, 12300154);
INSERT INTO `v1_28e7a4534da0fa02589ca9786c41749147ccabf68957cf661ffb9274f6cd661f` VALUES (4, 3001, 1, 1, 2, 0, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1, 3, 1, "vo_minigame_1012_result_1087", 5.53, 12300155);
INSERT INTO `v1_28e7a4534da0fa02589ca9786c41749147ccabf68957cf661ffb9274f6cd661f` VALUES (4, 3001, 3, 1, 2, 9, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 1, 3, 1, "vo_minigame_1012_result_1088", 0.01, 12300156);
