INSERT INTO `v1_28e7a4534da0fa02589ca9786c41749147ccabf68957cf661ffb9274f6cd661f` VALUES (4, 3001, 1, 2, 2, 0, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 1, 3, 1, "vo_minigame_1012_result_1092", 1.44, 12300160);
INSERT INTO `v1_28e7a4534da0fa02589ca9786c41749147ccabf68957cf661ffb9274f6cd661f` VALUES (4, 3001, 3, 3, 2, 0, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 1, 3, 1, "vo_minigame_1012_result_1093", 0.0, 12300161);
